<script src="runtime.b07f34f7855fc298.js" type="module"></script><script src="polyfills.300a37020c42cca3.js" type="module"></script><script src="main.294d82ef8020386c.js" type="module"></script>

<script type="text/javascript">
  (function(l) {
    if (l.search[1] === '/' ) {
      var decoded = l.search.slice(1).split('&').map(function(s) { 
        return s.replace(/~and~/g, '&')
      }).join('?');
      window.history.replaceState(null, null,
          l.pathname.slice(0, -1) + decoded + l.hash
      );
    }
  }(window.location))
</script>

</body></html>
